import React from 'react';

const Header = () => {
  const headerStyle = {
    backgroundColor: '#fff',
    padding: '20px 40px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    boxShadow: '0 2px 5px rgba(255, 255, 255, 0.1)',
  };

  const logoStyle = {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    color: '#333',
    letterSpacing: '2px',
  };

  const navListStyle = {
    display: 'flex',
    listStyle: 'none',
  };

  const navLinkStyle = {
    textDecoration: 'none',
    color: '#333',
    marginLeft: '20px',
    fontWeight: '500',
    transition: 'color 0.3s ease',
  };

  const navLinkHoverStyle = {
    color: '#007bff', // Color al pasar el mouse
  };

  return (
    <header style={headerStyle}>
      <h1 style={logoStyle}>Autos Force</h1>
      <nav>
        <ul style={navListStyle}>
          <li>
            <a href="/" style={navLinkStyle} onMouseEnter={(e) => e.target.style.color = navLinkHoverStyle.color} onMouseLeave={(e) => e.target.style.color = '#333'}>Inicio</a>
          </li>
          <li>
            <a href="/autos" style={navLinkStyle} onMouseEnter={(e) => e.target.style.color = navLinkHoverStyle.color} onMouseLeave={(e) => e.target.style.color = '#333'}>Autos</a>
          </li>
          <li>
            <a href="/contacto" style={navLinkStyle} onMouseEnter={(e) => e.target.style.color = navLinkHoverStyle.color} onMouseLeave={(e) => e.target.style.color = '#333'}>Contacto</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
